-width="112.94117647058823" data-original-x="9400"/><rect x="9399.798749999469" y="1200" width="107.06916666772791" height="200" fill="#77bb41" data-original-width="106.66666666666667" data-original-x="9400"/><rect x="9399.396250000531" y="1400" width="95.32514705776082" height="200" fill="#77bb41" data-original-width="94.11764705882352" data-original-x="9400"/><rect x="9398.59125000053" y="1600" width="58.50377450874204" height="200" fill="#77bb41" data-original-width="55.68627450980392" data-original-x="9400"/><rect x="9397.78625000053" y="1800" width="8.349068626389922" height="200" fill="#77bb41" data-original-width="3.9215686274509802" data-original-x="9400"/><rect x="9598.993749999468" y="1000" width="123.58112745204245" height="200" fill="#77bb41" data-original-width="121.56862745098039" data-original-x="9600"/><rect x="9599.798749999469" y="1200" width="2.75544117753183" height="200" fill="#77bb41" data-original-width="2.3529411764705883" data-original-x="9600"/><rect x="9798.18874999947" y="800" width="4.406813726550797" height="200" fill="#77bb41" data-original-width="0.7843137254901961" data-original-x="9800"/><rect x="9798.993749999468" y="1000" width="56.914460785375795" height="200" fill="#77bb41" data-original-width="54.90196078431373" data-original-x="9800"/><rect x="9799.798749999469" y="1200" width="1.1868137265514376" height="200" fill="#77bb41" data-original-width="0.7843137254901961" data-original-x="9800"/></svg>

    <script>
    // Comprehensive Utility Functions
    const noiseValues = {};
    
    function sq(x) {
        return Math.sin(x) >= 0 ? 1 : -1;
    }

    function radians(deg) {
        return deg * Math.PI / 180;
    }

    function noise(x) {
        const key = Math.floor(x * 100) / 100;
        if (!noiseValues[key]) {
            noiseValues[key] = Math.random();
        }
        return noiseValues[key];
    }

    function random(min, max) {
        if (max === undefined) {
            max = min;
            min = 0;
        }
        return Math.random() * (max - min) + min;
    }

    function log(x) {
        return Math.log(Math.max(0.1, Math.abs(x)));
    }

    // Exact Wave Calculation Function
    function calculateWaveOffset(y, time, waveType) {
        const freq = 0.66;
        const amp = 3.5;
        
        switch(waveType) {
            case "sin1":
                return Math.sin(y * 0.1 * freq + time) * 0.4 * amp;
            case "sin2":
                return Math.sin(y * 0.2 * freq + time) * 0.25 * amp;
            case "absSin":
                return Math.abs(Math.sin(y * 0.1 * freq + time)) * 0.5 * amp;
            case "complexSin":
                return Math.abs(Math.sin(y * 0.01 * freq + y * 0.1 * freq + time)) * 0.5 * amp;
            case "ceilSin":
                return Math.ceil(Math.sin(y * 0.1 * freq + time)) * 0.25 * amp;
            case "cosSin1":
                return (Math.abs(Math.cos(y * 0.1 * freq + time)) * 0.35 + Math.sin(y * 0.1 * freq + time) * 0.25) * amp;
            case "cosSin2":
                return (Math.abs(Math.cos(y * 0.1 * freq + time)) * -0.35 + Math.sin(y * 0.1 * freq + time) * 0.25) * amp;
            case "modSin":
                return (Math.sin(y * 0.1 * freq + time) * 0.25 % 0.15) * amp;
            case "modSin2":
                return (Math.sin(y * 0.1 * freq + time) * 0.7 % 0.4) * amp;
            case "sinCosCombo":
                return ((Math.sin(y * 0.1 * freq + time) * 0.25 - Math.cos(y * 0.1 * freq + time) * 0.25) % 0.15) * amp;
            case "ceilCosSin":
                return (Math.ceil(Math.cos(y * 0.1 * freq + time)) * 0.25 - Math.sin(y * 0.1 * freq + time) * 0.25) * amp;
            case "ceilTan":
                const tanVal = Math.tan(y * 0.1 * freq + time);
                const limitedTan = Math.max(Math.min(tanVal, 10), -10);
                return Math.ceil(limitedTan) * 0.25 * amp;
            case "roundNegSin":
                return Math.round(Math.sin(-y * 0.1 * freq - time)) * 0.25 * amp;
            case "sqSinPhase":
                return sq(Math.sin(Math.PI/2 + y * 0.1 * freq + time)) * 0.25 * amp;
            case "sqSin":
                return sq(Math.sin(y * 0.1 * freq + time)) * 0.25 * amp;
            case "doubleSin":
                return (Math.sin(y * 0.1 * freq + time) * 0.25 + Math.sin(y * 0.5 * freq + time) * 0.1) * amp;
            case "sinCosProduct":
                return Math.sin(y * 0.1 * freq + time) * Math.cos(y * 0.2 * freq + time) * 0.5 * amp;
            case "sinModX":
                return ((y * Math.sin(y * 0.1 * freq + time)) % 0.5) * amp;
            case "sinCosRadians":
                return Math.sin(y * 0.45 * freq + radians(y) + time) * Math.cos(y * 0.4 * freq + time) * 0.5 * amp;
            case "absModOffset":
                return Math.abs((y * 0.03 * freq + time) % (0.5 * 2) - 0.5) * amp;
            case "negModAdd":
                return (-1 * (y * 0.02 * freq + time) % 1) / 1 + 0.5 * amp;
            case "simpleMod":
                return (y * 0.03 * freq + time) % 0.5 * amp;
            case "negMod":
                return (-y * 0.03 * freq - time) % 0.5 * amp;
            case "logFunc":
                return log(Math.abs(y * freq) + 0.1) * 0.1 * amp;
            case "randomFunc":
                return random(Math.sin(y * 0.003 * freq + time)) * amp;
            case "noiseOffset":
                return (noise(y * 0.1 * freq + time) - 0.5) * amp;
            case "tanHigh":
                const tanHighVal = Math.tan((y * 20 * freq + time) % (Math.PI * 0.9));
                return Math.max(Math.min(tanHighVal, 10), -10) * 0.05 * amp;
            case "tanLow":
                const tanLowVal = Math.tan(y * 0.1 * freq + time);
                return Math.max(Math.min(tanLowVal, 10), -10) * 0.05 * amp;
            case "sinModProduct":
                return Math.sin(y * freq + time) * ((y * 0.01 * freq + time) % 0.5) * amp;
            case "sinModOffsetProduct":
                return Math.sin(y * freq + time) * ((y * 0.01 * freq + time) % 1 - 0.5) * amp;
            case "sinCosHighFreq":
                return Math.sin(y * 0.1 * freq + time) * Math.cos(y * 1 * freq + time) * 0.5 * amp;
            case "sinModProduct2":
                return Math.sin(y * 0.05 * freq + time) * ((y * 0.1 * freq + time) % 0.5) * amp;
            case "sinHighFreq":
                return Math.sin(y * 3.1 * freq + time) * 0.25 * amp;
            default:
                return Math.sin(y * freq + time) * amp;
        }
    }

    // Animation function
    function createWaveAnimation() {
        const svg = document.querySelector('svg');
        const rects = svg.querySelectorAll('rect');
        let time = 0;

        // Waveform type
        const waveform = "absModOffset";
        const spacing = 23;

        function animate() {
            time += 0.02;

            rects.forEach((rect, index) => {
                const y = parseFloat(rect.getAttribute('y')) || 0;
                
                // Ensure original attributes are used if available
                const originalWidth = parseFloat(rect.getAttribute('data-original-width') || rect.getAttribute('width'));
                const originalX = parseFloat(rect.getAttribute('data-original-x') || rect.getAttribute('x'));

                const waveOffset = calculateWaveOffset(y, time, waveform) * spacing;
                
                const newWidth = Math.max(originalWidth + waveOffset, 1);
                const newX = originalX - waveOffset / 2;
                
                rect.setAttribute('width', newWidth);
                rect.setAttribute('x', newX);
            });

            requestAnimationFrame(animate);
        }

        animate();
    }

    // Ensure SVG is fully loaded before starting animation
    window.addEventListener('load', createWaveAnimation);
    </script>
